"use strict";

const ObjectStoreError = require("./objectstore-error.js");

class ObjectNotFound extends ObjectStoreError {
  constructor(cause, message) {
    super(message || "Failed to update uuObject. UuObject was not found.", cause);
    this.code = `${ObjectStoreError.ERROR_PREFIX}objectNotFound`;
  }
}

module.exports = ObjectNotFound;
